import nltk
from string import punctuation
import pandas as pd

def task_func(text):
    if not isinstance(text, str):
        raise ValueError("if text is not a string")

    words = text.split()
    filtered_words = []

    for word in words:
        if word.startswith('$') and not all(char in punctuation for char in word):
            filtered_words.append(word)

    word_counts = {}
    for word in filtered_words:
        if word in word_counts:
            word_counts[word] += 1
        else:
            word_counts[word] = 1

    df = pd.DataFrame(list(word_counts.items()), columns=["Word", "Frequency"])
    return df.sort_index()
